// import webDesigns from "../webDesigns"
import terraNovaImg from '../assets/TerraNovaMockup.png'


const webDesigns = [
    {
        title: "Terra Nova Website",
        description: 'Website designed for a counseling company. The main goal for this site was to allow the user to find any and all information they needed for starting thier counseling sessions. To accomplish this goal I needed to be able to display a lot of information while keeping the pages pleasing to the eye to help the user stay focused.', 
        images: terraNovaImg,
    }, 
    {

    }
]

function Portfolio() {
    return(
        <div>
            <h2>Website Designs</h2>
            <div className='wedDesigns'>
                {webDesigns.map((designs) => {
                    return(
                        <div>
                            <h3>{designs.title}</h3>
                            <p>{designs.description}</p>
                            <img src={designs.images}/>
                        </div>
                    )
                })}
            </div>
        </div>
    )
}

export default Portfolio;
